import React from "react";
import "./Contact.css";

const Contact = () => {
  return (
    <div className="Contact">
      <head>
            <script src="https://kit.fontawesome.com/4c6cdc3d8d.js" crossorigin="anonymous"></script>
          </head>

          <body>
            <i class="fa-solid fa-thumbs-up fa-5x"></i>
          </body>
    </div>
  );
};
export default Contact;
